pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

import "./oraclizeAPI_0.5.sol";
import "./Patient.sol";
import "./DataProfile.sol";
import "./DataCreator.sol";
import "./Registration.sol";

contract OracleService is usingOraclize {
    mapping(uint256 => RetrievedData) public rd;
    mapping(bytes32 => uint256) oraclizeIdTrack;
    //mapping(bytes32 => bool) public pendingQueries;

    uint256 public lastRetrievedDataId;
    uint256[] public retrievedDataIds;

    DataProfile public dp;
    Registration public r;

    address public owner;
    uint256 public gas_limit = 3500000; // default 200000

    //uint256 public gas_price = 40000000000; // default 20000000000

    function setGasLimit(uint256 _gas_limit) public {
        gas_limit = _gas_limit;
    }

    /*function setGasPrice(uint256 _gas_price) public {
        gas_price = _gas_price;
        oraclize_setCustomGasPrice(gas_price);
    }*/

    enum State {PENDING, RETEIVED, UNSUCCESSFUL}

    modifier onlyOwner() {
        require(msg.sender == owner, "Only Admin can call this function");
        _;
    }

    modifier onlyDataRequester(address dr_contract) {
        (address _wallet, address _contract, , , bool _status) =
            r.drl(dr_contract);

        require(
            _wallet == msg.sender,
            "Error Code 5: Only DataRequester contract can call this function"
        );
        require(_status == true, "DataRequester contract has not approved yet");

        _;
    }

    modifier onlyDataCreator() {
        (, address dc_contract, , ) = r.dcl(msg.sender);
        require(
            dc_contract == msg.sender,
            "Only DataCreator contract can call this function"
        );
        _;
    }

    constructor(DataProfile _dp, Registration _r) public {
        require(
            address(_dp) != address(0),
            "Please provide DataProfile contract address"
        );
        require(
            address(_r) != address(0),
            "Please provide Registration contract address"
        );

        dp = _dp;
        r = _r;
        owner = msg.sender;
    }

    struct RetrievedData {
        bytes32 dataReference;
        address dataRequester;
        string otp;
        State state;
        uint256 accessToken;
        address dataCreator;
        address patient;
    }

    function getRequestInfo(uint256 _id)
        public
        view
        returns (bytes32 dataReference, address dataRequester)
    {
        dataReference = rd[_id].dataReference;
        dataRequester = rd[_id].dataRequester;
    }

    event retrieveDataLog(
        address indexed patient,
        bytes32 dataReference,
        address dataRequester,
        uint256 timestamp,
        State state
    );

    function __callback(bytes32 _oraclizeId, string memory _result) public {
        //require(msg.sender == oraclize_cbAddress());
        //require(pendingQueries[_oraclizeId] == true);

        if (
            keccak256(abi.encodePacked(_result)) ==
            keccak256(abi.encodePacked("")) || keccak256(abi.encodePacked(_result)) ==
            keccak256(abi.encodePacked("404"))
        ) {
            rd[oraclizeIdTrack[_oraclizeId]].state = State.UNSUCCESSFUL;
        } else {
            rd[oraclizeIdTrack[_oraclizeId]].otp = _result;
            rd[oraclizeIdTrack[_oraclizeId]].state = State.RETEIVED;
            DataCreator _dc =
                DataCreator(rd[oraclizeIdTrack[_oraclizeId]].dataCreator);
            _dc.disableAccessToken(
                rd[oraclizeIdTrack[_oraclizeId]].accessToken
            );
        }

        //delete pendingQueries[_oraclizeId];
    }

    function retrievData(uint256 _accessToken, address _dataCreatorContract)
        public
        payable
    {
        DataCreator _dc = DataCreator(_dataCreatorContract);

        (
            uint256 _accessTicketId,
            ,
            bool tokenStatus,
            address _dataRequesterContract,
            bytes32 _dataReference
        ) = _dc.getAccessToken(_accessToken);

        (address dr_walletAddress, , , , bool _status) =
            r.drl(_dataRequesterContract);
        require(
            dr_walletAddress == msg.sender,
            "Error Code 8: Only DataRequester can call this function"
        );
        require(_status == true, "DataRequester contract has not approved yet");

        require(tokenStatus, "Error Code 02: Access Token is expired");

        (address patientContract, , , , , ) = dp.getDataProfile(_dataReference);

        Patient p = Patient(patientContract);

        (, , , , bool ticketStatus, ) = p.getAccessTicket(_accessTicketId);

        require(
            ticketStatus,
            "Error Code 01: Access Ticket is not valid anymore"
        );

        (, , bytes memory oracleServiceServer, ) = r.dcl(_dataCreatorContract);

        //_dc.disableAccessToken(_accessToken);

        require(
            oraclize_getPrice("URL", gas_limit) < address(this).balance,
            "Provable query was NOT sent, please add some ETH to cover for the query fee"
        );

        lastRetrievedDataId++;

        bytes32 oraclizeId =
            oraclize_query(
                "URL",
                appendQuery(oracleServiceServer, lastRetrievedDataId),
                gas_limit
            );

        //pendingQueries[oraclizeId] == true;

        oraclizeIdTrack[oraclizeId] = lastRetrievedDataId;

        rd[oraclizeIdTrack[oraclizeId]].dataReference = _dataReference;
        rd[oraclizeIdTrack[oraclizeId]].dataRequester = _dataRequesterContract;
        rd[oraclizeIdTrack[oraclizeId]].dataCreator = _dataCreatorContract;
        rd[oraclizeIdTrack[oraclizeId]].accessToken = _accessToken;
        oraclizeIdTrack[oraclizeId] = lastRetrievedDataId;
        retrievedDataIds.push(lastRetrievedDataId);

        emit retrieveDataLog(
            patientContract,
            _dataReference,
            _dataRequesterContract,
            now,
            State.PENDING
        );
    }

    function getRetrievedDataList()
        public
        view
        returns (
            uint256[] memory,
            bytes32[] memory,
            address[] memory,
            string[] memory,
            State[] memory,
            bytes32[] memory
        )
    {
        uint256[] memory orders = new uint256[](retrievedDataIds.length);
        bytes32[] memory dataReferenceList =
            new bytes32[](retrievedDataIds.length);
        address[] memory dataRequesterList =
            new address[](retrievedDataIds.length);
        string[] memory otps = new string[](retrievedDataIds.length);
        State[] memory stateList = new State[](retrievedDataIds.length);
        bytes32[] memory oraclizeIdList =
            new bytes32[](retrievedDataIds.length);

        for (uint256 i = 0; i < retrievedDataIds.length; i++) {
            (address dr_walletAddress, , , , ) =
                r.drl(rd[retrievedDataIds[i]].dataRequester);

            if (dr_walletAddress == msg.sender) {
                orders[i] = i;
                dataReferenceList[i] = rd[retrievedDataIds[i]].dataReference;
                dataRequesterList[i] = rd[retrievedDataIds[i]].dataRequester;
                otps[i] = rd[retrievedDataIds[i]].otp;
                stateList[i] = rd[retrievedDataIds[i]].state;
            }
        }

        return (
            orders,
            dataReferenceList,
            dataRequesterList,
            otps,
            stateList,
            oraclizeIdList
        );
    }

    function appendQuery(bytes memory _server, uint256 _id)
        public
        pure
        returns (string memory)
    {
        return string(abi.encodePacked(_server, "getData/", uint2str(_id)));
    }

    function stringToBytes(string memory str)
        public
        pure
        returns (bytes memory)
    {
        return bytes(str);
    }
}
